import React from "react";
import Particles from "react-particles-js";
import video from '../../assets/video.mp4';

const particleOpt = {
  particles: {
    number: {
      value: 80,
      density: {
        enable: true,
        value_area: 500
      },
      color: {
        value: "#FE280A"
      },
    },

    "move": {
      "enable": true,
      "speed": 2.0,
      "direction": "right",
      "random": false,
      "straight": false,
      "out_mode": "out",
      "bounce": false,
      "attract": {
          "enable": false,
          "rotateX": 600,
          "rotateY": 1200
      }
  }
  }
};

const Home = () => {
  return (
    <div className="homeContainer">
      <Particles params={particleOpt} />
      <div className="video">
      <video width="320" height="240" loop autoPlay muted>
        <source src={video} type="video/mp4" />
         </video>
      </div>


    </div>
  );
};

export default Home;
